@Pure
	public static String getColorNameFromValue(int colorValue) {
		for (final Entry<String, Integer> entry : COLOR_MATCHES.entrySet()) {
			final int knownValue = entry.getValue().intValue();
			if (colorValue == knownValue) {
				return entry.getKey();
			}
		}
		return null;
	}
